import "./App.css";

function App() {
  const [time, setTime] = useState(0);

  return (
    <>
      {/* <div className="cls"> */}
      <div className="center" style={{ textAlign: "center" }}>
        <p> You clicked {time} times </p>
        <button onClick={(e) => setTime(time + 1)}> Click Here </button>
      </div>
      {/* </div> */}
    </>
  );
}

